(this["webpackJsonprunelite.net"]=this["webpackJsonprunelite.net"]||[]).push([[121],{399:function(e,n){e.exports={title:"1.6.9 Release",description:"Bank tag tabs tab and screenshot sub-folders",author:"Jordan",body:'<p>The <a href="https://github.com/runelite/runelite/wiki/Bank-Tags" native="" rel="nofollow">Bank Tags plugin</a> has a new right-click\nmenu option of the &quot;New tag tab&quot; button which will display each of your tag tabs as bank items,\nletting you quickly view and reorganize them. In addition, reordering tag tabs respects your bank\nrearrange mode selection. Thanks to <a href="https://github.com/raiyni" native="" rel="nofollow">@raiyni</a> for these features!</p>\n<p><img src="/img/blog/1.6.9-Release/bank-tag-tabs-tab.gif" alt="Bank tag tabs tab demonstration"></p>\n<p>The <a href="https://github.com/runelite/runelite/wiki/Screenshot" native="" rel="nofollow">Screenshot plugin</a> now stores all\nautomatic screenshots in sub-folders according to the screenshot type, such as Levels, Quests,\nBoss Kills, Valuable Drops, Pets, and more. Thanks to <a href="https://github.com/gregg1494" native="" rel="nofollow">@gregg1494</a>\nand <a href="https://github.com/nightfirecat" native="" rel="nofollow">@Nightfirecat</a> for adding this feature.</p>\n<p>There are also several smaller improvements and bug fixes, including:</p>\n<ul>\n<li>The &quot;highlight over value&quot; option now takes priority over the ground item price threshold colors. If you find all of your items are now highlighted, change the hightlight over value to be 0.</li>\n<li><a href="https://github.com/runelite/runelite/wiki/Information-about-the-Plugin-Hub" native="" rel="nofollow">Plugin Hub plugins</a>\nare now sorted by display name and are ordered in a more useful way when searched</li>\n<li>RuneLite now records your boss kill count and personal bests for the <a href="https://github.com/runelite/runelite/wiki/Chat-Commands" native="" rel="nofollow">Chat Commands\nplugin</a> when reading your POH\nadventurer\'s log</li>\n<li>The <a href="https://github.com/runelite/runelite/wiki/Item-Charges" native="" rel="nofollow">Item Charges plugin</a> now shows\ncharges for your amulets of bounty and amulets of chemistry</li>\n<li>Numerous hot-cold clues have had their locations made more precise to improve the <a href="https://github.com/runelite/runelite/wiki/Clue-Scroll" native="" rel="nofollow">Clue Scroll\nplugin\'s</a> narrowing feature</li>\n<li>Following the recent game update, the <a href="https://github.com/runelite/runelite/wiki/Clue-Scroll" native="" rel="nofollow">Clue Scroll\nplugin</a> now understands ornamented items\nfulfill emote clue requirements in the same way their un-ornamented versions do</li>\n<li>Mouse tooltips no longer go off-screen or overlap the mouse cursor when using the &quot;Above cursor&quot;\noption</li>\n<li>Mounted Mythical capes now display an icon with the <a href="https://github.com/runelite/runelite/wiki/Player-owned-House" native="" rel="nofollow">Player-owned House\nplugin</a></li>\n<li>A bug making it difficult to manually type new values into config text boxes with unit suffixes\nhas been fixed</li>\n<li>The <a href="https://github.com/runelite/runelite/wiki/Item-Stats" native="" rel="nofollow">Item Stats</a> equipment bonus tooltips no\nlonger confuse the attack speed difference for the attack stab difference</li>\n<li>Drift net rewards are now tracked in the <a href="https://github.com/runelite/runelite/wiki/Loot-Tracker" native="" rel="nofollow">Loot Tracker\nplugin</a></li>\n<li>The <a href="https://github.com/runelite/runelite/wiki/Agility" native="" rel="nofollow">Agility plugin</a> now uses <a href="https://github.com/runelite/runelite/wiki/XP-Drop#goals" native="" rel="nofollow">your ingame\ngoal</a> to determine laps to level</li>\n<li>Your <a href="https://github.com/runelite/runelite/wiki/Slayer" native="" rel="nofollow">active slayer task</a> is canceled when you\nleave the Inferno</li>\n<li>Guthix rests now have their xp values displayed in the <a href="https://github.com/runelite/runelite/wiki/Skill-Calculator" native="" rel="nofollow">Skill Calculator\nplugin</a></li>\n<li>Impling jars can now be labeled by the <a href="https://github.com/runelite/runelite/wiki/Item-Identification" native="" rel="nofollow">Item Identification\nplugin</a></li>\n<li>The <a href="https://github.com/runelite/runelite/wiki/Mining" native="" rel="nofollow">Mining plugin</a> learned the respawn times of\nWeiss salts</li>\n<li>The <a href="https://github.com/runelite/runelite/wiki/Report-Button" native="" rel="nofollow">Report Button plugin</a> can now show\nyour login time as a measure of game ticks</li>\n</ul>\n<p>Enjoy!</p>\n<p>- Jordan</p>\n<h3>New commits</h3>\n<p>We had 19 contributors this release!</p>\n<pre><code>Adam (4):\n      cache: update kit definition\n      point: lombokize\n      tooltips overlay: fix multiple above-cursor tooltips\n      itemcharges: move matchers after message type check\n\nAlexsuperfly (3):\n      chat commands: Refactor repeated test code into setup method\n      chat commands: Add KC reading from POH adventurer\'s log\n      chat commands: Add PB reading from POH adventurer\'s log\n\nDaniel Bolink (2):\n      itemcharges: Track Amulet of Chemistry charges\n      itemcharges: Track Amulet of Bounty charges\n\nDavid (1):\n      emote clue: Add missing ornament items\n\nDeliciousLunch55 (2):\n      clues: Improve Yanille dungeon basement clue hint\n      clues: Update &quot;Slay a nechryael&quot; clue text\n\nDeon Zhao (1):\n      HotColdLocation: Center South-east Dark Warriors\' Fortress location\n\nHydrox6 (1):\n      config: fix entering values directly into options with units not working\n\nJZomerlei (2):\n      Add Mythical Cape icon to POH (#10828)\n      Change to use github link instead of email (#10934)\n\nJordan Atwood (5):\n      util: Add subdirectory option to image captures\n      HotColdLocation: Center some location spots\n      item stats: Fix tooltip stab bonus comparison\n      itemstats: Fix unarmed attack speed\n      itemstats: Add tooltip string method tests\n\nRon Young (2):\n      tag tabs: respect bank rearrange mode for reordering\n      banktags: support viewing all Tag Tabs in the bank screen\n\nSkyler Olds (1):\n      Add AM/PM description to Timestamp Plugin Config (#10920)\n\nTomas Slusny (2):\n      Use XpTrackerService to determine goals in Agility plugin\n      Move matchesSearchTerms util to Text class\n\nZachary Waller (1):\n      ground items: change highlight value to take priority over other value thresholds\n\ndekvall (1):\n      loot tracker: add drift net reward\n\ngregg1494 (1):\n      screenshot plugin: Capture screenshots to subdirectories\n\njsnellings1 (2):\n      slayer: cancel task when leaving the Inferno\n      herblore skill calc: add guthix rest\n\nloldudester (4):\n      GroundItems: Keep item lists in input order\n      Plugin Hub: Sort plugins by display name\n      Plugin Hub: Rework search to something remotely useful\n      wintertodt plugin: separate notifications into separate options\n\nmelkypie (3):\n      itemidentification: add impling jars option\n      mining: update duration to use GAME_TICKS instead of milliseconds\n      mining: add urt, efh, te and basalt respawn timers\n\nmlvzk (1):\n      reportbutton: add Game Ticks option\n</code></pre>\n',image:"/img/blog/1.6.9-Release/bank-tag-tabs-tab.gif"}}}]);
